import "./C3.css";
import C3 from "./C3";
function Card3() {
  return (
    <div className="Card3">
      <C3
        image="https://images.pexels.com/photos/933964/pexels-photo-933964.jpeg?auto=compress&cs=tinysrgb&w=600"
        heading="Enchant your website visitors"
        text="Experience the pulse of the digital age with our modern trending website, delivering the latest trends and cutting-edge content at your fingertips."
      />
      <C3
        image="https://images.pexels.com/photos/4050291/pexels-photo-4050291.jpeg?auto=compress&cs=tinysrgb&w=400"
        heading="Boost your website's traffic"
        text="Unlock a world of visual innovation and captivate your audience with our creative latest graphics that push the boundaries of imagination."
      />
      <C3
        image="https://images.pexels.com/photos/6476191/pexels-photo-6476191.jpeg?auto=compress&cs=tinysrgb&w=600"
        heading="Captivate and convert"
        text="Elevate your brand's online presence with our fresh multimedia elements and engaging content copy that captivates and converts."





      />
    </div>
  );
}
export default Card3;
